import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import logo from '../assets/logo.svg';

function NavbarComponent() {
    // Define an array of nav links
    const navLinks = [
        { title: 'Home', href: '#home' },
        { title: 'About', href: '#about' },
        // Add more links as needed
    ];

    return (
        <Navbar sticky="top" expand="lg" className="bg-body-tertiary py-3">
            <Container>
                <Navbar.Brand className='d-flex justify-content-center align-items-center' href="#home">
                    <img alt="" src={logo} className="d-inline-block align-top headerLogo me-1"/>{' '}
                    Matteo Migliarese
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ms-auto">
                        {}
                        {navLinks.map((link, index) => (
                            <Nav.Link key={index} className='me-2' href={link.href}>{link.title}</Nav.Link>
                        ))}
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavbarComponent;
